import React, { useEffect, useState } from "react";

const App = () => {
const [num,setNum] = useState(0);
useEffect(()=>{
document.title = 'You clicked ${num} times';
})

  return (
<button onClick={()=>{
setNum(num+1)

}}>Click for more: {num}</button>
    )
}

export default App
